import { Container, Link, Text } from "@chakra-ui/react";
import Navbar from "./Navbar";


function Home(){
   
    return (
        <div>
             <Navbar/>
        <Container>
            <Text>Finally, time tracking that your team actually wants to use.</Text>
        </Container>
        </div>
    )
}

export default Home;
